// Podcast.js
import React from 'react';

const Podcast = () => {
  const season = 2;
  const episode = 10;
  const episodeTitle = "Episode Title";

  return (
    <div>
      <h2>Season: {season}</h2>
      <h3>Episode: {episode}</h3>
      <p>Episode Title: {episodeTitle}</p>
    </div>
  );
};

export default Podcast;
